import React, { useState } from "react";
import "./globalStyles.css";

import Home from "../pages/home";
import AboutTwo from "../pages/about-2";
import CourseTwo from "../pages/cursos";
import CourseSingle from "../pages/course/course-single";
import ContactTwo from "../pages/contact-2";
import Login from "../pages/login";
import Register from "../pages/register";
import Error from "../pages/404";
import LoadTop from "../components/Common/ScrollTop/LoadTop";
import Create from "../pages/create";
import Modify from "../pages/modify";
import AdminAllCourses from "../pages/admin-all-courses";
import AuthGuard from "../components/Auth/AuthGuard";
import AdminGuard from "../components/Auth/AdminGuard";
import useUserStore from "../store/useUserStore";

import { BrowserRouter, Route, Routes } from 'react-router-dom';

const App = () => {
  const [userRole, setUserRole] = useState("user"); // Assume 'user' role by default
  const { isAuthenticated } = useUserStore(); // Replace with your authentication logic

  return (
    <div className="App">
      <BrowserRouter>
        <LoadTop />
        {/* Exclude login and register from AuthGuard for accessibility */}
        <Routes>
          <Route path="/login" element={<Login />} />
          <Route path="/register" element={<Register />} />
          {/* Wrap other routes with AuthGuard */}
          <AuthGuard isAuthenticated={isAuthenticated}>
            <Routes>
              <Route path="/" element={<Home />} />
              <Route path="/home" element={<Home />} />
              <Route path="/about-2" element={<AboutTwo />} />
              <Route path="/cursos" element={<CourseTwo />} />
              <Route path="/contact-2" element={<ContactTwo />} />
              {/* Nested AdminGuard for additional protection */}
              <AdminGuard userRole={userRole}>
                <Routes>
                  <Route path="/create" element={<Create />} />
                  <Route path="/modify/:courseId" element={<Modify />} />
                  <Route path="/administrar-todos" element={<AdminAllCourses />} />
                  <Route path="/course/course-single/:id" element={<CourseSingle />} />
                </Routes>
              </AdminGuard>
              {/* Fallback route for unexpected paths */}
              <Route element={<Error />} />
            </Routes>
          </AuthGuard>
        </Routes>
      </BrowserRouter>
    </div>
  );
};

export default App;


